import React from "react";

// import Welcome from "./pages/Welcome";

const App = () => {
    const height = "106px";
    const width = "14rem";
  return (
    <>
      {/* <Welcome /> */}
      <div className={`grid grid-rows-3 grid-cols-2  w-[14rem] mx-auto gap-3 mt-4`}>
        <div className={`h-[${height}]`}>
            <div className="w-full h-full border-4 rounded-full border-black"></div>
        </div>
        <div className={`h-[${height}]`}>
            <div className="w-full h-full border-4 border-black border-r-0"></div>
        </div>
        <div className={`h-[${height}]`}>
            <div className="w-full h-full border-4 rounded-full border-black"></div>
        </div>
        <div className={`h-[${height}] relative`}>
            <div className="absolute bottom-0 w-[147px] h-1 bg-pink-500 origin-bottom-left -rotate-45"></div>
        </div>
        <div className="h-[106px] relative">
            <div className="absolute h-1 w-full bottom-0 bg-black"></div>
            <div className="absolute h-1 w-[118px] bottom-0 left-0 bg-black origin-bottom-left -rotate-[62deg]"></div>
            <div className="absolute h-1 w-[118px] bottom-0 right-0 bg-black origin-bottom-right rotate-[62deg]"></div>
        </div>
        <div className={`h-[${height}]`}>
            <div className="w-full h-full border-4 border-t-0 border-l-0 border-black"></div>
        </div>
      </div>
    </>
  );
};

export default App;
